  "translationLines": [
    {
      "lineNumber": 178151,
      "originalJapaneseLine": "三大国の姫達がお茶を飲んでいた。",
      "translatedEnglishLine": "The princesses of the three great nations were drinking tea."
    },
    {
      "lineNumber": 178152,
      "originalJapaneseLine": "「あの……いいんでしょうか…",
      "translatedEnglishLine": "\"Um... is this really okay...?"
    },
    {
      "lineNumber": 178153,
      "originalJapaneseLine": "　大事な準備の時間に私達だけこんな、",
      "translatedEnglishLine": "At such an important time of preparation, only we are like this,"
    },
    {
      "lineNumber": 178154,
      "originalJapaneseLine": "　お茶をいただいてのんびりとして……」",
      "translatedEnglishLine": "relaxing while drinking tea..."
    },
    {
      "lineNumber": 178155,
      "originalJapaneseLine": "「戦士でもないのに何を準備する気ー？」",
      "translatedEnglishLine": "\"What are you planning to prepare for when you're not even warriors?\""
    },
    {
      "lineNumber": 178156,
      "originalJapaneseLine": "「もうここまで来たら、",
      "translatedEnglishLine": "\"By the time we've come this far,"
    },
    {
      "lineNumber": 178157,
      "originalJapaneseLine": "　慌てたって仕方ないもんねー」",
      "translatedEnglishLine": "there's no point in panicking now.\""
    },
    {
      "lineNumber": 178158,
      "originalJapaneseLine": "「ふん、よく言うわ。",
      "translatedEnglishLine": "\"Hmph, you say that a lot."
    },
    {
      "lineNumber": 178159,
      "originalJapaneseLine": "　いつだってそうやって余裕ぶってる癖に」",
      "translatedEnglishLine": "You're always acting so nonchalant.\""
    },
    {
      "lineNumber": 178160,
      "originalJapaneseLine": "「あら、余裕は大事よー」",
      "translatedEnglishLine": "\"Oh, being composed is important.\""
    },
    {
      "lineNumber": 178161,
      "originalJapaneseLine": "「そうそう、それと……」",
      "translatedEnglishLine": "\"That's right, and also...\""
    },
    {
      "lineNumber": 178162,
      "originalJapaneseLine": "「この中の誰が死んでも、",
      "translatedEnglishLine": "\"If any one of us dies,"
    },
    {
      "lineNumber": 178163,
      "originalJapaneseLine": "　後のことは恨みっこなし……",
      "translatedEnglishLine": "there will be no grudges afterwards..."
    },
    {
      "lineNumber": 178164,
      "originalJapaneseLine": "　で、いいわよねー？」",
      "translatedEnglishLine": "That's fine, right?\""
    },
    {
      "lineNumber": 178165,
      "originalJapaneseLine": "「後のこと……ねえ……？」",
      "translatedEnglishLine": "\"What do you mean by 'afterwards'... huh...?\""
    },
    {
      "lineNumber": 178166,
      "originalJapaneseLine": "「もちろん、",
      "translatedEnglishLine": "\"Of course,"
    },
    {
      "lineNumber": 178167,
      "originalJapaneseLine": "　誰がダーリンの正室になるか、",
      "translatedEnglishLine": "it's about who becomes Darling's official wife."
    },
    {
      "lineNumber": 178168,
      "originalJapaneseLine": "　って話よ」",
      "translatedEnglishLine": "That's what we're talking about.\""
    },
    {
      "lineNumber": 178169,
      "originalJapaneseLine": "「へ？　え……？」",
      "translatedEnglishLine": "\"Huh? Eh...?"
    },
    {
      "lineNumber": 178170,
      "originalJapaneseLine": "「自分だけは死なないって顔して……",
      "translatedEnglishLine": "\"You act like you're the only one who won't die..."
    },
    {
      "lineNumber": 178171,
      "originalJapaneseLine": "　その自信がどこから来るのか、",
      "translatedEnglishLine": "I really want to know where that confidence comes from..."
    },
    {
      "lineNumber": 178172,
      "originalJapaneseLine": "　一度ジックリ伺いたいわね……」",
      "translatedEnglishLine": "I'd like to ask you about it carefully sometime...\""
    },
    {
      "lineNumber": 178173,
      "originalJapaneseLine": "「ま、化けて出てきてくれてもいいけどねー。",
      "translatedEnglishLine": "\"Well, I wouldn't mind if you came back as a ghost, though."
    },
    {
      "lineNumber": 178174,
      "originalJapaneseLine": "　迷わないよう成仏させてあげる」",
      "translatedEnglishLine": "I'll help you rest peacefully so you don't get lost.\""
    },
    {
      "lineNumber": 178175,
      "originalJapaneseLine": "「ホント、大した自信ね……」",
      "translatedEnglishLine": "\"Really, such great confidence...\""
    },
    {
      "lineNumber": 178176,
      "originalJapaneseLine": "「別に私達全員が死んでも、",
      "translatedEnglishLine": "\"Even if all of us die,"
    },
    {
      "lineNumber": 178177,
      "originalJapaneseLine": "　ランスがあんたみたいな下品な女、",
      "translatedEnglishLine": "there's no guarantee that Rance will choose a vulgar woman like you,"
    },
    {
      "lineNumber": 178178,
      "originalJapaneseLine": "　選ぶとは限らないんじゃない？」",
      "translatedEnglishLine": "you know?\""
    },
    {
      "lineNumber": 178179,
      "originalJapaneseLine": "「デコちゃんよりは確実かなー」",
      "translatedEnglishLine": "\"Probably more certain than Deco-chan though.\""
    },
    {
      "lineNumber": 178180,
      "originalJapaneseLine": "「あんた……！」",
      "translatedEnglishLine": "\"You...!\""
    },
    {
      "lineNumber": 178181,
      "originalJapaneseLine": "「……くっ、いえ、やめましょう。",
      "translatedEnglishLine": "\"...Tch, no, let's stop this."
    },
    {
      "lineNumber": 178182,
      "originalJapaneseLine": "　無駄な体力は使いたくないもの」",
      "translatedEnglishLine": "We don't want to waste any unnecessary energy.\""
    },
    {
      "lineNumber": 178183,
      "originalJapaneseLine": "（お二人とも……",
      "translatedEnglishLine": "(Both of them..."
    },
    {
      "lineNumber": 178184,
      "originalJapaneseLine": "　自国のことが心配なのに、",
      "translatedEnglishLine": "even though they're worried about their countries,"
    },
    {
      "lineNumber": 178185,
      "originalJapaneseLine": "　毅然と普段通り振る舞われて……）",
      "translatedEnglishLine": "they act resolutely and behave as usual...)"
    },
    {
      "lineNumber": 178186,
      "originalJapaneseLine": "（ご立派です……",
      "translatedEnglishLine": "(How admirable..."
    },
    {
      "lineNumber": 178187,
      "originalJapaneseLine": "　私も見習わないと……）",
      "translatedEnglishLine": "I have to learn from them as well...)"
    },
    {
      "lineNumber": 178188,
      "originalJapaneseLine": "（なんか……",
      "translatedEnglishLine": "(Somehow..."
    },
    {
      "lineNumber": 178189,
      "originalJapaneseLine": "　この子一人だけズレたこと考えてそうね……）",
      "translatedEnglishLine": "this one seems to be thinking differently from the rest...)"
    },
    {
      "lineNumber": 178190,
      "originalJapaneseLine": "「はぁーあ、とっととダーリンが",
      "translatedEnglishLine": "\"Haaah, I wish Darling would just quickly"
    },
    {
      "lineNumber": 178191,
      "originalJapaneseLine": "　ケイブリスなんて倒してくれたらいいのになー」",
      "translatedEnglishLine": "defeat Cavebris already.\""
    },
    {
      "lineNumber": 178192,
      "originalJapaneseLine": "残る者――",
      "translatedEnglishLine": "Those who remain—"
    },
    {
      "lineNumber": 178193,
      "originalJapaneseLine": "「あの、何をなさってるんですか？」",
      "translatedEnglishLine": "\"Um, what are you doing?\""
    },
    {
      "lineNumber": 178194,
      "originalJapaneseLine": "海岸には沢山の船員が",
      "translatedEnglishLine": "On the beach, many sailors"
    },
    {
      "lineNumber": 178195,
      "originalJapaneseLine": "大量の荷を動かしていた。",
      "translatedEnglishLine": "were moving a large amount of cargo."
    },
    {
      "lineNumber": 178196,
      "originalJapaneseLine": "「おー、船内にゃまだ使えるものがあるからな。",
      "translatedEnglishLine": "\"Oh, there are still usable things inside the ship."
    },
    {
      "lineNumber": 178197,
      "originalJapaneseLine": "　荷の運び出しと整理を少しな」",
      "translatedEnglishLine": "We're just moving and organizing the cargo a bit.\""
    },
    {
      "lineNumber": 178198,
      "originalJapaneseLine": "「あの、皆さんはこれからどうなさるんですか？」",
      "translatedEnglishLine": "\"Um, what will you all do from now on?\""
    },
    {
      "lineNumber": 178199,
      "originalJapaneseLine": "「俺らじゃ決戦の場についていっても",
      "translatedEnglishLine": "\"If it's us, even if we go to the battlefield"
    },
    {
      "lineNumber": 178200,
      "originalJapaneseLine": "　死ぬだけだからなぁ……",
      "translatedEnglishLine": "we'll only end up dying..."
    },
    {
      "lineNumber": 178201,
      "originalJapaneseLine": "　ここに残る他にねぇな」",
      "translatedEnglishLine": "So there's no choice but to stay here.\""
    },
    {
      "lineNumber": 178202,
      "originalJapaneseLine": "「そ、そうですか……」",
      "translatedEnglishLine": "\"I-is that so...\""
    },
    {
      "lineNumber": 178203,
      "originalJapaneseLine": "「……ん？」",
      "translatedEnglishLine": "\"...Hm?\""
    },
    {
      "lineNumber": 178204,
      "originalJapaneseLine": "「へっ、そんな顔すんなよ。",
      "translatedEnglishLine": "\"Heh, don't make that face."
    },
    {
      "lineNumber": 178205,
      "originalJapaneseLine": "　帰りが船じゃねぇのは分かってたんだ。",
      "translatedEnglishLine": "I knew our return wouldn't be by ship."
    },
    {
      "lineNumber": 178206,
      "originalJapaneseLine": "　ここまで報酬に入ってる仕事だよ」",
      "translatedEnglishLine": "This job comes with that part of the payment.\""
    },
    {
      "lineNumber": 178207,
      "originalJapaneseLine": "「それに皆が無事に勝ったなら、",
      "translatedEnglishLine": "\"Besides, if everyone wins safely,"
    },
    {
      "lineNumber": 178208,
      "originalJapaneseLine": "　回収してもらって",
      "translatedEnglishLine": "they'll come to pick us up,"
    },
    {
      "lineNumber": 178209,
      "originalJapaneseLine": "　俺らも一緒に帰る手筈になってる」",
      "translatedEnglishLine": "and we are arranged to return together.\""
    },
    {
      "lineNumber": 178210,
      "originalJapaneseLine": "「吉報を持ってきてくれるのを",
      "translatedEnglishLine": "\"Waiting for them to bring good news"
    }
  ]
}

